import React, { Component } from 'react';
import axios from "axios";
import {Link} from "react-router-dom";


class StageFour extends Component {

    constructor(props){
        super(props);
        this.state={lastArr:[]}
    }

    componentDidMount(){
        var getData = localStorage.getItem('myData');
        var newData = JSON.parse(getData);
        var arr=[newData];
        this.setState({lastArr:arr} , function () {
            console.log(this.state.lastArr);
        });

    }

    componentDidUpdate(){return true;}

    render() {
        var data = this.state.lastArr.name;
        
        return (
            <div className="">
                <h1>Your'e Data</h1>
                {data}
            </div>
        );
    }
}

export default StageFour;
